import React from "react";
import PropTypes from "prop-types";
import Link from "next/link";

const AppLayout = ({ children }) => {
  return (
    <div>
      <div>
        <Link href="/">
          <a>노드버드</a>
        </Link>
      </div>
      {children}
    </div>
  );
};

AppLayout.PropTypes = {
  children: PropTypes.node.inRequired,
};

export default AppLayout;
